import { createStore } from 'vuex';
import axios from 'axios';
const session = axios.get('/sessionid');
console.log(session)
export default createStore({
  state: {
    userData: {},
    userlogin: false,
    logindata: session || {},
  },
  getters: {
  },
  mutations: {
    setUserData(state, data) {
      state.userData = data;
    },
    setuserlogin(state, data) {
      state.userlogin = data;
    }
  },
  actions: {
  },
});
